var Angles=function(){};Angles.prototype.toRadians=function(a){var d,b=a.match(/deg|grad|rad|turn/)[0],c=a.match(/[.0-9]{1,}/)[0];switch(b){case"rad":d=c;break;case"deg":d=c*(Math.PI/180);break;case"grad":d=c*(Math.PI/200);break;case"turn":d=c*2*Math.PI}return d},Angles.prototype.toDegrees=function(a){var d,b=a.match(/deg|grad|rad|turn/)[0],c=a.match(/[.0-9]{1,}/)[0];switch(b){case"deg":d=c;break;case"grad":d=c/(400/360);break;case"rad":d=c*(180/Math.PI);break;case"turn":d=360*c}return d},Angles.prototype.toGradians=function(a){var d,b=a.match(/deg|grad|rad|turn/)[0],c=a.match(/[.0-9]{1,}/)[0];switch(b){case"deg":d=c*(10/9);break;case"grad":d=c;break;case"rad":d=c*(200/Math.PI);break;case"turn":d=400*c}return d},Angles.prototype.toTurns=function(a){var d,b=a.match(/deg|grad|rad|turn/)[0],c=a.match(/[.0-9]{1,}/)[0];switch(b){case"deg":d=c/360;break;case"grad":d=c/400;break;case"rad":d=c/(2*Math.PI);break;case"turn":d=c}return d};